import React from "react";

export default function QuizQuestions(props) {
  console.log(props);
  return (
    <div>
      <h3 class="text-center">{props.question.question}</h3>
      {props.question.answers.map((ans) => {
        return (
          <div class="input-group mb-3">
            <input type="radio" name="ans" />
            {ans}
          </div>
        );
      })}
    </div>
  );
}
